import * as React from 'react';
import { TextField } from '@material-ui/core';
import { Formik, Form} from 'formik';
import { Button } from '@material-ui/core';
import './form.css';



interface Values {
    firstName: string;
    lastName: string;
    email: string;
    msg: string; // This is not a large enough variable type but for now it'll do.
}


interface Props {
    onSubmit: (values: Values) => void; //Values as my parameter



}

export const MkForm: React.FC<Props> = ({ onSubmit }) => {
    return (
        <Formik
        initialValues={{firstName: '', lastName: '', email: '', msg: ''}} 
        onSubmit={(values) => {
            onSubmit(values);
        }}>
            {({ values, handleChange, handleBlur}) => (
                <Form>
                    <div id="formWrapper">
                        <div class="smallTextFields">
                        <TextField 
                            name="firstName" 
                            id="outlined-basic" 
                            label="First Name" 
                            variant="outlined"
                            value={values.firstName}
                            onChange={handleChange}
                            onBlur={handleBlur}
                            />
                        <TextField 
                            name="firstName" 
                            id="outlined-basic" 
                            label="First Name" 
                            variant="outlined"
                            value={values.firstName}
                            onChange={handleChange}
                            onBlur={handleBlur}

                            />
                        <TextField 
                            name="firstName" 
                            id="outlined-basic" 
                            label="First Name" 
                            variant="outlined"
                            value={values.firstName}
                            onChange={handleChange}
                            onBlur={handleBlur}

                            />
                        </div>
                        <div id="largeTextFields">
                        <TextField 
                            name="firstName" 
                            id="outlined-basic" 
                            label="First Name" 
                            variant="outlined"
                            value={values.firstName}
                            onChange={handleChange}
                            onBlur={handleBlur}

                            />

                        </div>
                    </div>
                    <Button type="submit">Submit</Button>
                </Form>
            )}
        </Formik>
    );
}
